 href="//meta.wikimedia.org" /> <!--[if lt IE 9]><script src="/w/load.php?debug=false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Orang rootpage-Orang skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Orang</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><p><b>Orang</b> is a <a href="/wiki/Malay_language" title="Malay language">Malay</a>/<a href="/wiki/Indonesian_language" title="Indonesian language">Indonesian</a> word that means "people" or "man". It may also refer to:</p> <table role="presentation" class="mbox-small plainlinks sistersitebox" style="background-color:#f9f9f9;border:1px solid #aaa;color:#000"> <tr> <td class="mbox-image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/40px-Wiktionary-logo-en-v2.svg.png" width="40" height="40" class="noviewer" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/60px-Wiktionary-logo-en-v2.svg.png 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/9/99/Wiktionary-logo-en-v2.svg/80px-Wiktionary-logo-en-v2.svg.png 2x" data-file-width="391" data-file-height="391" /></td> <td class="mbox-text plainlist">Look up <i><b><a href="https://en.wiktionary.org/wiki/orang" class="extiw" title="wiktionary:orang">orang</a></b></i> in Wiktionary, the free dictionary.</td> </tr> </table> <p></p> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Peoples"><span class="tocnumber">1</span> <span class="toctext">Peoples</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#Places"><span class="tocnumber">2</span> <span class="toctext">Places</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#Primates"><span class="tocnumber">3</span> <span class="toctext">Primates</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#Other"><span class="tocnumber">4</span> <span class="toctext">Other</span></a></li> </ul> </div> <p></p> <h2><span class="mw-headline" id="Peoples">Peoples</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Orang&amp;action=edit&amp;section=1" title="Edit section: Peoples">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Orang_Asli" title="Orang Asli">Orang Asli</a>, original peoples, the pre-Malay peoples of the Malayan peninsula</li> <li>Orang Lanta, people of the <a href="/wiki/Lanta_Islands" class="mw-redirect" title="Lanta Islands">Lanta Islands</a></li> <li><a href="/wiki/Orang_Laut" class="mw-redirect" title="Orang Laut">Orang Laut</a>, sea people, the people of the Riau Islands</li> </ul> <h2><span class="mw-headline" id="Places">Places</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Orang&amp;action=edit&amp;section=2" title="Edit section: Places">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Orang_County" title="Orang County">Orang County</a>, a county in North Hamgyong province, North Korea</li> <li><a href="/wiki/Orang_National_Park" title="Orang National Park">Orang National Park</a>, in Assam, India</li> <li><a href="/wiki/Orang,_Nepal" title="Orang, Nepal">Orang, Nepal</a></li> </ul> <h2><span class="mw-headline" id="Primates">Primates</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Orang&amp;action=edit&amp;section=3" title="Edit section: Primates">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>Orang is a Malay and Indonesian word for "person".</p> <ul> <li>An <a href="/wiki/Orang_Mawas" title="Orang Mawas">Orang Mawas</a>, a <a href="/wiki/Southeast_Asia" title="Southeast Asia">southeast Asia</a>n primate <a href="/wiki/Cryptid" class="mw-redirect" title="Cryptid">cryptid</a>, about 2.5 meters tall</li> <li>An <a href="/wiki/Orang_Pendek" title="Orang Pendek">Orang Pendek</a>, a <a href="/wiki/Southeast_Asia" title="Southeast Asia">southeast Asia</a>n primate <a href="/wiki/Cryptid" class="mw-redirect" title="Cryptid">cryptid</a>, about 1 meter tall</li> <li>An <a href="/wiki/Orangutan" title="Orangutan">orangutan</a></li> </ul> <h2><span class="mw-headline" id="Other">Other</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Orang&amp;action=edit&amp;section=4" title="Edit section: Other">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/.O.rang" title=".O.rang">.O.rang</a>, a British band</li> <li><a href="/wiki/Ourang_Medan" title="Ourang Medan">Ourang Medan</a>, a <a href="/wiki/Ghost_ship" title="Ghost ship">ghost ship</a> which became <a href="/wiki/Shipwreck" title="Shipwreck">shipwreck</a> in <a href="/wiki/Indonesia" title="Indonesia">Indonesian</a> ocean.</li> </ul> <table id="disambigbox" class="metadata plainlinks dmbox dmbox-disambig" style="" role="presentation"> <tr> <td class="mbox-image" style="padding: 2px 0 2px 0.4em;"><a href="/wiki/File:Disambig_gray.svg" class="image"><img alt="Disambiguation icon" src="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/30px-Disambig_gray.svg.png" width="30" height="23" srcset="//upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/45px-Disambig_gray.svg.png 1.5x, //upload.wikimedia.org/wikipedia/en/thumb/5/5f/Disambig_gray.svg/60px-Disambig_gray.svg.png 2x" data-file-width="220" data-file-height="168" /></a></td> <td class="mbox-text" style="padding: 0.25em 0.4em; font-style: italic;">This <a href="/wiki/Help:Disambiguation" title="Help:Disambiguation">disambiguation</a> page lists articles associated with the title <b>Orang</b>.<br /> <small>If an <a class="external text" href="//en.wikipedia.org/w/index.php?title=Special:WhatLinksHere/Orang&amp;namespace=0">internal link</a> led you here, you may wish to change the link to point directly to the intended article.</small></td> </tr> </table>   <!--  NewPP limit report Parsed by mw1261 Cached time: 20171218214044 Cache expiry: 1900800 Dynamic content: false CPU time usage: 0.052 seconds Real time usage: 0.084 seconds Preprocessor visited node count: 1187/1000000 Preprocessor generated node count: 0/1500000 Post‐expand include size: 4074/2097152 bytes Template argument size: 621/2097152 bytes Highest expansion depth: 15/40 Expensive parser function count: 1/500 Lua time usage: 0.014/10.000 seconds Lua memory usage: 939 KB/50 MB --> <!-- Transclusion expansion time report (%,ms,calls,template) 100.00%   71.877      1 -total  73.31%   52.692      1 Template:Disambig  47.13%   33.872      1 Template:Dmbox  26.52%   19.059      1 Template:Wiktionary  24.83%   17.847      1 Template:Category_handler  24.49%   17.602      1 Template:Sister_project  21.37%   15.360      1 Template:Side_box  15.61%   11.220      1 Template:Main_other  13.56%    9.745      2 Template:Title_disambig_text   9.70%    6.974     10 Template:Disambiguation/cat --> </div> <!-- Saved in parser cache with key enwiki:pcache:idhash:4260758-0!canonical and timestamp 20171218214043 and revision id 813121867  --> <noscript><img src="//